description:
Faithless - Featuring Kelli McCarty (Former Miss USA)

Meet Kelli McCarty...a true, genuine, former Miss U.S.A., and star of the NBC soap opera Passions. But you can only spend so long pleasing your public, the networks, your lovers and other judges. Then it's time to please yourself. And does she ever. Presenting Faithless, the controversial, ground-breaking drama from adult's most awarded director Paul Thomas...in which Kelli shocks every world she's ever been in, from network television to national beauty pageants...and rocks your world all at the same time.

Beyond beautiful, beyond hot, beyond belief. Kelli McCarty is Faithless.

